import axios from 'axios'

export default () => {
    const logoutPromise = axios({
        url: `${window.apiHost}/logout`,
        method: 'POST',
        data: {}
    })
    return {
        type: "LOGOUT_ACTION",
        payload: logoutPromise
    }
}
